import './App.css';
import Header from './MyComponents/Header';
import { Todos } from './MyComponents/Todos';
import { Footer } from './MyComponents/Footer';

function App() {
  let todos=[
    {
      sno:1,
      title:"go to market",
      desc:"but veges"
    },{
      sno:1,
      title:"go to market",
      desc:"but veges"
    },{
      sno:1,
      title:"go to market",
      desc:"but veges"
    }
  ]
  return (
    <>
    <Header title="My Todos List" searchBar={false}/>
    <Todos todos={todos}/>
    <Footer/>
    </>
  );
}

export default App;
